(function(){"use strict";onmessage=function({data:r}){const{filterName:o}=r;if(o==="searchTermFilter"){const{currentData:s,searchText:e}=r;let t=s.filter(({quote:i})=>!(i.toLowerCase().indexOf(e.toLowerCase())<0));this.postMessage(JSON.stringify(t))}if(o==="wordCountFilter"){const{quotes:s,end:e,start:t}=r,i=s.filter(({quote:f})=>{const n=f.split(" ").filter(function(u){return u!==""}).length;return!!(e&&e!==""&&n>=t&&n<=e||e===""&&n>=t)});this.postMessage(JSON.stringify(i))}}})();
